process.on("uncaughtException", (err) => {
  console.error(" Uncaught Exception:", err);
  console.log(" Restarting bot...");
  process.exit(1);
});

process.on("unhandledRejection", (reason, promise) => {
  console.error(" Unhandled Rejection:", reason);
  console.log(" Restarting bot...");
  process.exit(1);
});


process.on("SIGINT", () => {
  console.log(" Bot stopped by user (SIGINT)");
  process.exit(0);
});

process.on("SIGTERM", () => {
  console.log(" Bot stopped (SIGTERM)");
  process.exit(0);
});


const PORT = process.env.PORT || global.config.port
app.listen(PORT, async () => {
  const green = "\x1b[32m";
  const cyan = "\x1b[36m";
  const yellow = "\x1b[33m";
  const blue = "\x1b[34m";
  const magenta = "\x1b[35m";
  const reset = "\x1b[0m";
  const dhakaTime = new Date().toLocaleString("en-US", { timeZone: "Asia/Dhaka" });

  console.log(`${cyan}
=================================
   BOT STATUS : INITIALIZING
=================================
${reset}`);

  let info = null;

  if (global.config.pageAccessToken) {
    try {
      info = await getUserInfo();
      if (info && info.id) {
        await checkBotBan(info.id);
        console.log(`${green}  Page Status: ACTIVE${reset}`)
        console.log(`${magenta}  Page Name  : ${info.name}${reset}`);
        console.log(`${magenta}  Page ID    : ${info.id}${reset}\n`);
      } else {
        console.log(`${yellow}  Page info not available. Bot will run without page info.${reset}\n`);
      }
    } catch (err) {
      console.log(`${red}  Failed to fetch Page info. Bot will run without page info.${reset}`);
    }
  } else {
    console.log(`${yellow}  Page Access Token not set. Bot will run in limited mode.${reset}\n`);
  }

  console.log(`${green}  Server   : ONLINE${reset}`);
  console.log(`${yellow}  Port     : ${PORT}${reset}`);
  console.log(`  Started  : ${dhakaTime} (BD Time)`);
  console.log(`  Platform : Node.js`);
  console.log(`   Mode     : Production\n`);

  console.log(`${green}
=================================
  Bot is ready to accept tasks
=================================
${reset}`);
});
